import styled from "styled-components";

const Father = styled.div`
  display: flex;
`;


const Box = styled.div`
  background-color : ${(props) => props.bgColor};
  width: 100px;
  height: 100px;
`;

//box의 모든 속성을 가져온 후 작성한 내용만 추가 
const Circle = styled(Box)`
  border-radius: 50px;
`;

function App() {
  return <Father>
    <Box bgColor="teal"/>
    <Box bgColor="whitesmoke"/>
  </Father>;
}

export default App;
